import React, {useState} from 'react'
// import {useDispatch} from 'react-redux';
// import {Link} from 'react-router-dom';
// import {addData} from '../actions/index';
// import {connect} from 'react-redux';


const Login = props => {

//   const dispatch = useDispatch();



  const [firstName, setFirstName] = useState("");
  const [lastName,setLastName] = useState("");
  const [email,setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [mobileNumber,setMobileNumber]=useState("")
//   const [response, setResponse] = useState("");

  const handleLogin = (evt) => {
      evt.preventDefault();
      console.log(firstName);

    //   dispatch(addData(name,password,email,password));
      setfirstName('');
      setPassword('');
      setEmail('');
      setPassword('');
      setMobileNumber('');
  }

  return(
    <div>
    {/* <Navbar /> */}
    <center>
    <div className="loginMain">
      <div className="loginLogo">
        <div className="loginContent">

        </div>
      </div>
      <div className="registerContent">

      </div>
      <div className="col-6 inputFields">
          <center>
        <form onSubmit={handleLogin}>
            <div className="">
              <label>
              <input className="form-control" type="text"
              value={firstName}
              onChange={e => setFirstName(e.target.value)}
              placeholder="FirstName" required/>
              </label>
            </div>

            <div className="">
              <label>
              <input className="form-control" type="text"
              value={lastName}
              onChange={e => setLastName(e.target.value)}
              placeholder="LastName" required/>
              </label>
            </div>

            <div className="">
              <label>
              <input className="form-control" type="email"
              value={email}
              onChange={e => setEmail(e.target.value)}
              placeholder="Email" required/>
              </label>
            </div>

            <div className="">
              <label>
              <input className="form-control" type="password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              placeholder="Password" required/>
              </label>
            </div>

            <div className="">
              <label>
              <input className="form-control" type="text"
              value={mobileNumber}
              onChange={e => setMobileNumber(e.target.value)}
              placeholder="mobileNumber" required/>
              </label>
            </div>


            <div className="inputFields">
            <center>  <input className="btn-sm login" type="submit" value="Register" /></center>
            </div>
            {/* <Link to="/display"> Dispaly</Link> */}
        </form>
        </center>
      </div>
    </div></center>

    </div>
  );
}
export default Login;
